        <div id="container">
            <div id="content">
                <h1>Welkom bij Nederland Stemt!</h1>
                <p>Welkom op Nederland Stemt! De stem pagina van het land!<br></br>
                Klik op een onderwerp om een stem uit te brengen.
                </p>
                <div id="subjects">
                    <h3>Drinken</h3>
                    <p>Iedereen heeft altijd een mening over welke drankjes het beste of het</p>
                    <Link></Link>
                </div>
            </div>
        </div>
    );

};

export default Home;
